    movieDetails=JSON.parse(localStorage.getItem("movies")) || [];
var a=0;

setInterval(()=>{
    var imagediv=document.createElement("div");
    imagediv.setAttribute("class","imagediv");
    var imageElement=document.createElement("img");
    imageElement.src=movieDetails[a].imageUrl;
    imagediv.append(imageElement);
    document.querySelector("#slideshow").innerHTML=""
    document.querySelector("#slideshow").append(imagediv)
    a++;
    if(a>movieDetails.length-1){
        a=0;
    }
}, 2000)


window.addEventListener("load", loadimageGridCreator)

function loadimageGridCreator(){
    imageGridCreator(movieDetails);
}
document.querySelector("#sortForm").addEventListener("submit",sortmoviescreator)

function sortmoviescreator(){
    event.preventDefault();
    var sortArr= movieDetails;
    var sortType=document.querySelector("#sortOptions").value;
    if(sortType=="select"){
        window.addEventListener("load", loadimageGridCreator)
    }else if(sortType=="lowToHigh"){
        sortArr.sort(function(a,b){
           return a.rating-b.rating;
        })
    }else{
        sortArr.sort(function(a,b){
            return b.rating-a.rating;
         })
    }
    imageGridCreator(sortArr);
}

function imageGridCreator(arr){
    event.preventDefault();
    arr.forEach(element => {
        var moviediv=document.createElement("div");
        moviediv.setAttribute("class", "moviediv");

        var imageElement=document.createElement("img");
        imageElement.src=element.imageUrl;
        var imagediv=document.createElement("div")
        imagediv.append(imageElement);
        imagediv.setAttribute("class","movieimagediv")

        var imageNamediv=document.createElement("div");
        imageNamediv.setAttribute("class","imagenamediv");
        var imageNameElement=document.createElement("h2");
        imageNameElement.innerText=element.name;
        imageNamediv.append(imageNameElement);

        var releaseElement=document.createElement("p");
        releaseElement.innerText="Date of Release :"+element.releaseDate;

        var ratingElement=document.createElement("p");
        ratingElement.innerText="Rating :"+element.rating;

        var releaseDteAndRatingdiv=document.createElement("div");
        releaseDteAndRatingdiv.append(releaseElement,ratingElement);
        releaseDteAndRatingdiv.setAttribute("class","releaseDteAndRatingdiv")

        moviediv.append(imagediv, imageNamediv, releaseDteAndRatingdiv);
        
        document.querySelector("#movies").append(moviediv)
                
    });
}






